@Yeonmi_Park's account of her experience at Columbia University is harrowing - as someone who had just arrived in the West after her escape from North Korea, the idea that she had to censor herself at a prestigious university like Columbia, or any university for that matter -  which have historically been bastions of free thought is horrifying. Her experience serves as one example of just how far the Universities have deteriorated.

I wanted to put this together because I still feel like it’s possible to save the Universities, but more people need to be aware of just how twisted they’ve become before that can happen.

Watch the full video on YouTube via the link in my bio.

